import React from 'react'
import PropTypes from 'prop-types'
import { BrowserRouter as Router, Link, Switch, Route } from 'react-router-dom'
import Dashboard from '../pages/Dashboard'

function Card({ values }) {
  return (
    <Router>
      <div>
        {values.map((ele) => {
          return (
            <Link to={`/${ele.id}`} key={ele.id}>
              <div className="homepage-card" key={ele.id}>
                <h1>{ele.name}</h1>
              </div>
            </Link>
          )
        })}
      </div>
      <div>
        {values.map((ele) => {
          return (
            <Switch key={ele.key}>
              <Route
                path={`/${ele.id}`}
                key={ele.id}
                component={Dashboard}
              ></Route>
            </Switch>
          )
        })}
      </div>
    </Router>
  )
}

Card.propTypes = {
  values: PropTypes.array.isRequired,
  toLoad: PropTypes.bool.isRequired
}
export default Card
